import React from 'react';

const ProductList = ({ products }) => {
    return (
        <div>
            <h2>Products</h2>
            <ul>
                {products.map((product) => (
                    <li key={product._id}>
                        {product.title} (Category: {product.category.title})
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ProductList;
